import './App.css';
import React, { useState, useEffect } from 'react';
import DucksList from './pages/ducksList';


function App() {
  const [activeTab, setActiveTab] = useState('warehouse');
  var title = activeTab === 'warehouse' ?"Duck Warehouse":"Duck Store";

  return (
    <div className="App">

    <nav >
      <button className='button2' onClick={() => setActiveTab('warehouse')}>
        Duck Warehouse
      </button>
      <button className='button2' onClick={() => setActiveTab('store')}>
        Duck Store
      </button>
    </nav>

   <h1 className='h1'>{title}</h1> 

    {activeTab === 'warehouse' && (
        <DucksList mode="warehouse" />
      )}
      {activeTab === 'store' && (
        <DucksList mode="store" />
      )}
  </div>
);
}

export default App;
